import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <h1>Welcome to My Portfolio</h1>
      <p>This is the Home page.</p>
      <div style={{ marginTop: "20px" }}>
        <Link to="/login">
          <button style={btnStyle}>Login</button>
        </Link>
        <Link to="/signup">
          <button style={{ ...btnStyle, backgroundColor: "#00d4ff", color: "#222" }}>
            Sign Up
          </button>
        </Link>
      </div>
    </div>
  );
}

const btnStyle = {
  padding: "10px 20px",
  margin: "0 10px",
  backgroundColor: "#222",
  color: "white",
  border: "2px solid #00d4ff",
  borderRadius: "5px",
  cursor: "pointer",
  fontSize: "16px",
};

export default Home;
